export default class extends React.Component {
  render() {
    return (
      <div>
        <h1>¡Hola Damián!</h1>
        <p>Bievenido a Next.Js</p>

        <img src='/static/platzi-logo.png' alt='Platzi' />

        <style jsx>{`
          h1 {
            color: #fff;
            margin: 0 auto
          }
          div :global(p) {
            color: #ccc;
          }
          img {
            max-width: 10%;
            display: block;
            margin 0 auto;
          }
        `}</style>

        <style jsx global>{`
          body {
            background: #333;
          }
        `}</style>
      </div>
    );
  }
}
